// Projects.js
import React from "react";

const Projects = () => {
  return (
    <section className="section-image" id="projects">
      <div className="img-overlay"></div>
      <div className="container">
        <div className="row">
          <div className="col-md-12 section-heading">
            <h2>Projects</h2>
            <p className="lead">Selected Works</p>
            <hr />
          </div>
        </div>
        <div className="row">
          {[
            { title: "Personal Portfolio", description: "A personal website showcasing my work and skills.", link: "https://github.com/Nairinn/personal-portfolio" },
            { title: "Online Store", description: "A full-stack e-commerce application with user authentication and product management.", link: "https://github.com/Nairinn/online-store" },
            { title: "Blog Platform", description: "A blogging platform where users can create, edit, and delete posts.", link: "https://github.com/Nairinn/blog-platform" },
          ].map((project, index) => (
            <div className="col-md-4 project-item" key={index}>
              <h3>{project.title}</h3>
              <p>{project.description}</p>
              <a href={project.link} target="_blank" rel="noopener noreferrer">View Project</a>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Projects;
